import React from 'react';

const Login = () => {
  return(
    <div>
      <header>
        <div>
          <p>Login</p>
        </div>
      </header>
      <section>
        <div>
          <p>EMAIL</p>
          <p>SENHA</p>
        </div>
      </section>
    </div>
  );
}

export default Login;
